import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the first product card's "Add to Cart" button (using .add-to-cart inside .product-card)
    // Try several selector strategies for robustness
    // 1. Wait for any .add-to-cart button
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });

    // 2. Find the first visible .add-to-cart button inside a .product-card
    const addToCartButton = await page.$('.product-card .add-to-cart');
    if (!addToCartButton) {
      throw new Error('Could not find the first product "Add to Cart" button');
    }

    // Take screenshot before clicking Add to Cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_before_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_before_add_to_cart.png'));

    // Click the first Add to Cart button
    await addToCartButton.click();

    // Wait for notification to appear (success message)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_add_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_add_to_cart.png'));

    // Extract cart count from the cart icon (should increment to 1)
    // The cart count is in an element with id="cartCount"
    await page.waitForSelector('#cartCount', { timeout: 5000 });
    const cartCountText = await page.$eval('#cartCount', el => el.textContent.trim());

    // Optionally, extract the notification text for verification
    const notificationText = await page.$eval('.notification.success', el => el.textContent.trim());

    return {
      success: true,
      action: "Added the first product to cart and verified cart count incremented.",
      extractedData: {
        cartCount: cartCountText,
        notification: notificationText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
